import React from 'react'
import './Home.css'
import NavBar from '../NavBar/NavBar'
import ContactUsButton from '../images/Contact_Us_Button.png'
import ContactUsButtonFilled from '../images/Contact_Us_Button_Filled.png'

interface HomeProps {
    renderLinks: JSX.Element[]
}

const Home: React.FC<HomeProps> = props => {
    const SwitchImage = () => {
        console.log(document.getElementById("OnHoverContact").src)
    }

    return (
        <div id="Home" className='debug-border'>
            <NavBar renderLinks={props.renderLinks} />
            <h1 >WELCOME MESSAGE</h1>
            <div id="ContactUsButton">
                <img id="OnHoverContact" src={ContactUsButton} height='251px' onMouseOver={SwitchImage}/>
            </div>
        </div>
    )
}

export default Home
